const traverse = function (root) {
  // \u5982\u679C\u5F53\u524D\u8282\u70B9\u4E3A\u7A7A\uFF0C\u5219\u8FD4\u56DE
  if (root == null) return;
  // \u904D\u5386\u8FC7\u7684\u6BCF\u4E2A\u8282\u70B9\u7684\u503C\u52A0\u4E00
  root.val++;
  // \u9012\u5F52\u904D\u5386\u5DE6\u5B50\u6811
  traverse(root.left);
  // \u9012\u5F52\u904D\u5386\u53F3\u5B50\u6811
  traverse(root.right);
};
